import React, { useEffect } from "react";
import { useAppDispatch, useAppSelector } from "../redux/hook";
import { fetchCity } from "../redux/SliceApi";
import { useParams } from "react-router-dom";

const SerachFilterData = () => {
  const { userData } = useParams();
  const dispatch = useAppDispatch();
  const data = useAppSelector((state) => state.detail);
  useEffect(() => {
    dispatch(fetchCity());
  }, [dispatch]);
  const filterData = data.cityData.filter((item) =>
    item.city.toLowerCase().includes(userData?.toLowerCase())
  );
  console.log(filterData, "hello");
  return <div></div>;
};

export default SerachFilterData;
